    t[236] = "Advanced Router Configuration";
    t[237] = "Zaawansowana konfiguracja routera";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Alokuj liczb\u0119 w\u0105tk\u00f3w procesora do budowania tuneli. Je\u015bli procesor obs\u0142uguje hyperthreading lub wielow\u0105tkowo\u015b\u0107 r\u00f3wnoleg\u0142\u0105, mo\u017cna pomno\u017cy\u0107 liczb\u0119 rdzeni procesora przez 2, aby uzyska\u0107 maksymaln\u0105 liczb\u0119 do alokacji w\u0105tk\u00f3w, w przeciwnym razie liczba rdzeni procesora = maksymalna liczba dost\u0119pnych w\u0105tk\u00f3w. Nale\u017cy zauwa\u017cy\u0107, \u017ce mo\u017cliwe jest, \u017ceby przydzieli\u0107 mniej ni\u017c teoretyczne maksimum, aby zapewni\u0107 zapas dla innych zada\u0144.";
