    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Gdy tworzony jest nowy tunel us\u0142ugowy lub us\u0142uga jest uruchamiana po raz pierwszy (np. domy\u015blny serwer sieci web jetty, wtyczki), tworzony jest prywatny klucz szyfrowania, kt\u00f3ry odpowiada za w\u0142asno\u015b\u0107 adresu. Zazwyczaj jest on nazwany <code>&hellip;privKey.dat</code> lub <code>eepPriv.dat</code>, ale warto zmieni\u0107 nazw\u0119, aby wskaza\u0107 us\u0142ug\u0119, do kt\u00f3rej nale\u017cy, a nast\u0119pnie ponownie zdefiniowa\u0107 w ustawieniach serwera mened\u017cera tuneli. Ten plik .dat powinien by\u0107 bezpiecznie zarchiwizowany. Je\u015bli go zgubisz, stracisz w\u0142asno\u015b\u0107 i kontrol\u0119 nad swoj\u0105 nazw\u0105 hosta!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "To ustawienie umo\u017cliwia konfiguracj\u0119 maksymalnej liczby plik\u00f3w na torrent, kt\u00f3re I2PSnark b\u0119dzie akceptowa\u0142 podczas pobierania lub tworzenia torrenta. Nale\u017cy zauwa\u017cy\u0107, \u017ce znaczne zwi\u0119kszenie tej warto\u015bci z domy\u015blnych 2000 plik\u00f3w mo\u017ce wymaga\u0107 dodatkowej konfiguracji na systemie hosta w celu zwi\u0119kszenia maksymalnej liczby otwartych plik\u00f3w, kt\u00f3re pozwoli system operacyjny (np. <code>ulimit -n</code> w systemie Linux). Aby dokona\u0107 zmiany, dodaj do pliku konfiguracyjnego I2PSnark <code>i2psnark.config</code>. [Wymagane ponowne uruchomienie I2PSnark lub routera]";
