    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Wybierz nazw\u0119 dla swojej strony internetowej (<i>nazwa_hosta</i>.i2p) u\u017cywaj\u0105c ma\u0142ych liter. Aby sprawdzi\u0107 dost\u0119pno\u015b\u0107 nazwy_hosta, sprawd\u017a <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> lub <a href=http://reg.i2p target=_blank>reg.i2p</a> zanim podejmiesz decyzj\u0119. Wprowad\u017a now\u0105 nazw\u0119 dla swojej strony internetowej na stronie <a href='/i2ptunnel/edit?tunnel=3'>Konfiguracji Mened\u017cera tuneli</a> w miejscu, gdzie jest napisane <i>Nazwa strony internetowej</i>, zast\u0119puj\u0105c domy\u015blny zast\u0119pczy tekst <i>mojastrona.i2p</i>. Je\u015bli chcesz, aby Twoja strona internetowa by\u0142a dost\u0119pna podczas uruchomienia I2P, w\u0142\u0105cz <i>Uruchomienie automatyczne</i>, a nast\u0119pnie kliknij <i>Zapisz</i>.";
