    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Premie mog\u0105 by\u0107 dodatnie lub ujemne i wp\u0142ywa\u0107 na w\u0142\u0105czenie partnera do poziom\u00f3w Szybka i Wysoka Pojemno\u015b\u0107. W tunelach klienckich u\u017cywane s\u0105 szybkie elementy r\u00f3wnorz\u0119dne, a w niekt\u00f3rych tunelach eksploracyjnych u\u017cywane s\u0105 elementy r\u00f3wnorz\u0119dne o du\u017cej przepustowo\u015bci.";
    t[618] = "Yes";
