    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "Je\u015bli rzeczywi\u015bcie dysponujesz pasmem szerszym ni\u017c 128KB/sek i tak skonfigurowany I2P b\u0119dzie dzia\u0142a\u0107 poprawnie, to znacznie bardziej wspomo\u017cesz sie\u0107 otwieraj\u0105c firewall.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Aplikacja wiersza polece\u0144 do\u0142\u0105czona do I2P, kt\u00f3ra jest u\u017cywana do \u017c\u0105dania zasob\u00f3w URL, podobnie jak <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> lub <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget jest r\u00f3wnie\u017c u\u017cywany wewn\u0119trznie przez router, np. do odnawiania zasob\u00f3w z zdalnych host\u00f3w. Domy\u015blnie eepget u\u017cywa serwera proxy HTTP na <code>127.0.0.1:4444</code>.";
