    t[723] = "Dokumenty Java";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Eepsite to strona internetowa, kt\u00f3ra jest hostowana anonimowo w sieci I2P - mo\u017cna si\u0119 do niej dosta\u0107, konfiguruj\u0105c przegl\u0105dark\u0119 internetow\u0105 do korzystania z serwera proxy HTTP I2P (patrz powy\u017cej) i u\u017cywaj\u0105c przegl\u0105darki internetowej do odwiedzania strony z sufiksem <code>.i2p</code> (np. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Upewnij si\u0119 r\u00f3wnie\u017c, \u017ce przegl\u0105darka jest skonfigurowana do zdalnego rozwi\u0105zywania nazw DNS podczas korzystania z serwera proxy, aby unikn\u0105\u0107 wyciek\u00f3w DNS.";
