    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Pierwsza liczba to liczba partner\u00f3w, z kt\u00f3rymi tw\u00f3j router wymieni\u0142 si\u0119 wiadomo\u015bciami w ci\u0105gu ostatnich kilku minut. Mo\u017ce to wynosi\u0107 od 8 do kilkuset, w zale\u017cno\u015bci od ca\u0142kowitej przepustowo\u015bci, udost\u0119pnionej przepustowo\u015bci i generowanego lokalnie ruchu. Druga liczba to liczba partner\u00f3w widzianych w ci\u0105gu ostatniej godziny lub oko\u0142o takiej. Nie martw si\u0119, je\u015bli te liczby si\u0119 znacznie r\u00f3\u017cni\u0105. <a href='/configstats#router.activePeers'>[W\u0142\u0105cz wykresy]</a>.";
