    t[878] = "This setting permits disabling SSU tests to determine if your router is firewalled and can be enabled for routers that are definitely not firewalled but are experiencing intermittent firewalling issues. In the event that testing is disabled, both SSU and NTCP should report your current public ip address on <a href=/info>the router info page</a>. [Restart required]";
    t[879] = "To ustawienie pozwala wy\u0142\u0105czy\u0107 testy SSU w celu ustalenia, czy tw\u00f3j router ma zapor\u0119 sieciow\u0105 i mo\u017cna je w\u0142\u0105czy\u0107 dla router\u00f3w, kt\u00f3re z pewno\u015bci\u0105 nie maj\u0105 zapor\u0119 sieciow\u0105, ale maj\u0105 problemy z okresow\u0105 blokad\u0105 zapory. Je\u015bli testowanie jest wy\u0142\u0105czone, zar\u00f3wno SSU, jak i NTCP powinny raportowa\u0107 tw\u00f3j obecny adres IP publiczny na <a href=/info>stronie informacyjnej routera</a>. [Wymagany restart]";
