    t[977] = "Dost\u0119pny z zewn\u0105trz adres IP lub nazwa hosta";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Tw\u00f3j serwer WWW domy\u015blnie dzia\u0142a pod adresem <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, ale nie jest dost\u0119pny dla innych, dop\u00f3ki nie uruchomisz tunelu <i>I2P Webserver</i>. Po uruchomieniu tunelu Twoja strona b\u0119dzie trudna do znalezienia przez innych u\u017cytkownik\u00f3w. Mo\u017cesz po prostu poda\u0107 ludziom cel lub adres Base32, ale na szcz\u0119\u015bcie I2P ma ksi\u0105\u017ck\u0119 adresow\u0105 do przechowywania nazw domen oraz r\u00f3\u017cne us\u0142ugi, za pomoc\u0105 kt\u00f3rych mo\u017cesz <a href=/help/hostnameregistration>zarejestrowa\u0107 now\u0105 domen\u0119 .i2p za darmo</a>.";
