    t[1002] = "When set to false, the router will not throttle tunnel build requests from other routers, and should be used with caution. [Default is true, restart required]";
    t[1003] = "Gdy ustawione na fa\u0142sz, router nie ogranicza \u017c\u0105da\u0144 budowy tuneli od innych router\u00f3w i nale\u017cy go u\u017cywa\u0107 ostro\u017cnie. [Domy\u015blnie prawda, wymagane ponowne uruchomienie]";
