    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "W przypadku braku skonfigurowania serwera po\u015brednicz\u0105cego dla us\u0142ugi, z kt\u00f3r\u0105 chcesz si\u0119 po\u0142\u0105czy\u0107, nie jest to mo\u017cliwe, z wyj\u0105tkiem BitTorrenta (patrz poni\u017cej). Obecnie istniej\u0105 tylko trzy rodzaje serwer\u00f3w po\u015brednicz\u0105cych: HTTP, HTTPS i poczta e-mail. Nale\u017cy zauwa\u017cy\u0107, \u017ce obecnie nie ma publicznie dost\u0119pnych serwer\u00f3w SOCKS. Je\u015bli wymaga si\u0119 tego rodzaju us\u0142ugi, spr\u00f3buj <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
