    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Odchylenie (offset) zegara twojego komputera wzgl\u0119dem zsynchronizowanego czasu sieciowego (je\u015bli jest znany). I2P wymaga dok\u0142adno\u015bci czasu twojego komputera. Je\u015bli odchylenie przekracza kilka sekund, prosz\u0119 skoryguj ten problem, zmieniaj\u0105c czas na swoim komputerze. Je\u015bli I2P nie mo\u017ce po\u0142\u0105czy\u0107 si\u0119 z internetem, mo\u017ce zosta\u0107 wy\u015bwietlone odczyt 0ms. Uwaga: To jest wy\u015bwietlane tylko w sekcji <i>Informacje o routerze (zaawansowane)</i>. Mo\u017cesz doda\u0107 t\u0119 sekcj\u0119 do panelu bocznego na stronie <a href='/configsidebar'>Konfiguracja panelu bocznego</a>.";
