    t[2185] = "Pomoc przy ponownym wysiewie";
    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "Nast\u0119puj\u0105ca definicja progu <i class=example>180/60</i> okre\u015bla, \u017ce to samo zdalne miejsce docelowe mo\u017ce wykonywa\u0107 179 pr\u00f3b po\u0142\u0105czenia w ci\u0105gu 60 sekund. Je\u015bli wykona jeszcze jedn\u0105 pr\u00f3b\u0119 w tym samym okresie, pr\u00f3g zostanie przekroczony, a kolejne pr\u00f3by po\u0142\u0105czenia zostan\u0105 odrzucone do ko\u0144ca okresu:";
    t[2190] = "config home";
