    t[2206] = "Version";
    t[2207] = "Wersja";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P wybiera losowy port mi\u0119dzy 9000 a 31000, aby komunikowa\u0107 si\u0119 z innymi routerami przy pierwszym uruchomieniu programu lub gdy zmienia si\u0119 zewn\u0119trzny adres IP w trybie <a href=/confignet#ipchange>Laptop Mode</a>. <a href=/confignet#udpconfig>Wybrany port</a> jest wy\u015bwietlany na <a href=/confignet>stronie konfiguracji sieciowej</a>.";
    t[2212] = "Message send rate (B/s)";
    t[2213] = "Szybko\u015b\u0107 wysy\u0142ania wiadomo\u015bci (B/s)";
    t[2214] = "Update or check already in progress";
    t[2215] = "Trwa ju\u017c aktualizacja lub sprawdzanie";
    t[2218] = "Log date format";
    t[2219] = "Format daty w logach";
    t[2226] = "Less than 256MB allocated to the JVM";
    t[2227] = "Mniej ni\u017c 256 MB przydzielone do JVM";
    t[2230] = "Average closest floodfill distance";
    t[2231] = "\u015arednia najbli\u017csza odleg\u0142o\u015b\u0107 do zalewu";
    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Wymaganych jest przynajmniej 10 minut od uruchomienia routera, aby by\u0142 gotowy do akceptacji tworzenia uczestnicz\u0105cych tuneli, co ma na celu zapewnienie, \u017ce Tw\u00f3j router jest stabilny i pomy\u015blnie zainicjalizowany w sieci.";
    t[2234] = "Last Heard From";
    t[2235] = "Ostation s\u0142yszano od";
    t[2236] = "midnight";
    t[2237] = "p\u00f3\u0142noc";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Delikatne wprowadzenie do protoko\u0142u I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Jak d\u0142ugo zadania czekaj\u0105 przed wykonaniem. Kolejka zada\u0144 jest wymieniona na <a href='/jobs'>stronie zadan</a>. Niestety, w routerze znajduje si\u0119 kilka innych kolejek zada\u0144, kt\u00f3re mog\u0105 by\u0107 przeci\u0105\u017cone, a ich status nie jest dost\u0119pny w konsoli routera. Op\u00f3\u017anienie zadania powinno zazwyczaj wynosi\u0107 zero. Je\u015bli jest stale wy\u017csze ni\u017c 500ms, tw\u00f3j komputer jest bardzo wolny, twoja sie\u0107 ma problemy z \u0142\u0105czno\u015bci\u0105 lub router ma powa\u017cne problemy. <a href='/configstats#jobQueue.jobLag'>[W\u0142\u0105cz wykresy]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Konfiguracja aktualizacji I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Zanim powiesz \u015bwiatu o swojej nowej stronie internetowej, powiniene\u015b doda\u0107 nieco tre\u015bci. Otw\u00f3rz g\u0142\u00f3wny katalog serwera <a href=#rootdir>wymieniony powy\u017cej</a> i zast\u0105p stron\u0119 przekierowania <i>index.html</i> w\u0142asn\u0105 zawarto\u015bci\u0105. Je\u015bli potrzebujesz szablonu dla podstawowej strony, mo\u017cesz swobodnie dostosowa\u0107 <a href=http://127.0.0.1:7658/help/pagetemplate.html>t\u0119 stron\u0119</a>. Je\u015bli po edycji zawarto\u015bci wr\u00f3cisz na t\u0119 stron\u0119, spr\u00f3buj wyczy\u015bci\u0107 pami\u0119\u0107 podr\u0119czn\u0105 przegl\u0105darki.";
