    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Je\u017celi tw\u00f3j router ma 10 lub wi\u0119cej aktywnych w\u0119z\u0142\u00f3w, wszystko jest w porz\u0105dku. Router powinien utrzymywa\u0107 po\u0142\u0105czenia z kilkoma w\u0119z\u0142ami przez ca\u0142y czas. Najlepszym sposobem, aby by\u0107 \u201elepiej po\u0142\u0105czonym\u201d z sieci\u0105, jest <a href=/config>dzielienie si\u0119 wi\u0119ksz\u0105 przepustowo\u015bci\u0105</a>.";
