    t[2371] = "S\u0142ownik";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Aby uzyska\u0107 w\u0142asn\u0105 nazw\u0119 hosta, takie jak <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink> stats.i2p </a> lub <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink> reg.i2p </a> dostawcy rejestracji domen I2P dostarczaj\u0105 us\u0142ugi rejestracji domen, kt\u00f3re umo\u017cliwiaj\u0105 rejestracj\u0119 i zarz\u0105dzanie hostem .i2p lub poddomen\u0105, kt\u00f3re nast\u0119pnie zostan\u0105 rozmieszczone w sieci. Niekt\u00f3re strony rejestracji b\u0119d\u0105 wymaga\u0142y wzorca <i>adresu docelowego B64</i> do tunelu/us\u0142ugi, kt\u00f3r\u0105 chcesz przypisa\u0107 do nazwy hosta, kt\u00f3ry powiniene\u015b skopiowa\u0107 z sekcji <i>Lokalna lokalizacja</i> na stronie <a href=' http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3 '> Konfiguracja mened\u017cera tuneli. </a>";
