    t[2471] = "R\u0119cznie ustawienia uczestnika";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "To wskazuje ilo\u015b\u0107 pami\u0119ci RAM, kt\u00f3r\u0105 I2P zu\u017cywa, i ca\u0142kowit\u0105 dost\u0119pn\u0105 ilo\u015b\u0107 przydzielon\u0105 przez Jav\u0119. Je\u015bli zu\u017cycie jest stale wysokie w por\u00f3wnaniu do dost\u0119pnej pami\u0119ci RAM, mo\u017ce to oznacza\u0107, \u017ce musisz zwi\u0119kszy\u0107 pami\u0119\u0107 RAM przydzielon\u0105 do JVM. Mo\u017cesz przydzieli\u0107 wi\u0119cej pami\u0119ci RAM, edytuj\u0105c sw\u00f3j plik <code>wrapper.config</code>, kt\u00f3ry zazwyczaj znajduje si\u0119 w katalogu aplikacji I2P. Nale\u017cy edytowa\u0107 parametr <code>wrapper.java.maxmemory</code>, kt\u00f3ry domy\u015blnie ustawiony jest na 256 (MB) dla I2P lub 384 dla I2P+. Uwaga: je\u015bli pasek pami\u0119ci jest w\u0142\u0105czony, wpis dotycz\u0105cy pami\u0119ci w sekcji informacji o routerze zostanie ukryty.";
