    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Pod <i>Konfiguruj dost\u0119p do internetu za pomoc\u0105 proxy</i> wybierz opcj\u0119 <i>R\u0119czna konfiguracja proxy</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Aby udost\u0119pni\u0107 w\u0142asne statyczne tre\u015bci, wystarczy edytowa\u0107 lub zamieni\u0107 pliki w katalogu g\u0142\u00f3wnym serwera WWW; strona b\u0119dzie dost\u0119pna w sieci I2P po wykonaniu poni\u017cszych instrukcji. Dodatkowo, skrypty cgi i python mo\u017cna uruchamia\u0107 z katalogu <code>cgi-bin</code>, kt\u00f3ry znajduje si\u0119 tu\u017c nad katalogiem <code>docroot</code>, je\u015bli masz zainstalowane <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> i <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
