    t[2573] = "Wtyczka b\u0119dzie zainstalowana przy nast\u0119pnym restarcie.";
    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Wiele statystyk na bocznym panelu mo\u017cna <a href='/configstats'>skonfigurowa\u0107</a> w celu <a href='/graphs'>wygenerowania wykresu</a> na potrzeby dalszej analizy. Mo\u017cesz r\u00f3wnie\u017c dostosowa\u0107 sekcje, kt\u00f3re pojawiaj\u0105 si\u0119 na panelu bocznym oraz ich po\u0142o\u017cenie na stronie <a href='/configsidebar'>Konfiguracja panelu bocznego</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "To ustawienie specyficzne dla tunelu pozwala w\u0142\u0105cza\u0107 lub wy\u0142\u0105cza\u0107 odpowiedzi na pingi wysy\u0142ane do serwer\u00f3w hostowanych przez router. Aby wy\u0142\u0105czy\u0107 pingi, musisz doda\u0107 lini\u0119 <code>i2p.streaming.answerPings=false</code> do sekcji <i>Niestandardowe opcje</i> konfiguracji serwera w Mened\u017cerze tuneli.";
    t[2592] = "Max";
    t[2593] = "Maksimum";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Je\u015bli chcesz zainstalowa\u0107 niepodpisane aktualizacje I2P (.zip), nale\u017cy to doda\u0107 do pliku <code>router.config</code>, chyba \u017ce ju\u017c skonfigurowano <code>routerconsole.advanced=true</code>, w przypadku kt\u00f3rego ta opcja jest ju\u017c dost\u0119pna. Uwaga: od wersji I2P+ 0.9.48+ instalacja <a href=/configupdate#i2pupdates>niepodpisanych aktualizacji</a> jest domy\u015blnie w\u0142\u0105czona.";
