    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Je\u015bli znasz i ufasz komu\u015b, kto u\u017cywa I2P, popro\u015b go o wys\u0142anie Ci pliku reseed, kt\u00f3ry zosta\u0142 wygenerowany za pomoc\u0105 tej strony w jego konsoli routera. Nast\u0119pnie wybierz opcj\u0119 <i>Reseed z pliku</i> na {0} u\u017cywaj\u0105c otrzymanego pliku.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "Aby w\u0142\u0105czy\u0107 zmiany dotycz\u0105ce tylko sesji w tunelach klienta, aktywuj <a href=\"/help/advancedsettings\">Tryb zaawansowany</a> konsoli.";
