    t[2683] = "Konfiguracja \u0142\u0105cza Ethernet'owego WAN";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Ta opcja (w sekundach) pozwala na zast\u0105pienie op\u00f3\u017anienie mi\u0119dzy uruchomieniami zadania eksploracji par, kt\u00f3re pr\u00f3buje znale\u017a\u0107 nowe pary do dodania do NetDb. Zadanie b\u0119dzie wykonywane co 80 sekund domy\u015blnie lub, je\u015bli router do\u015bwiadcza op\u00f3\u017anie\u0144 w zadaniach lub wiadomo\u015bciach, to co 3 minuty. Je\u015bli rozmiar NetDb osi\u0105gnie 4000 par, przerwa wzro\u015bnie do 15 minut. Mo\u017cesz zwi\u0119kszy\u0107 op\u00f3\u017anienie, je\u015bli Tw\u00f3j NetDb jest dobrze zaludniony (ponad 2000 par), lub je\u015bli chcesz zmniejszy\u0107 og\u00f3lne zu\u017cycie przepustowo\u015bci. Uwaga: Dla router\u00f3w Floodfill to zadanie nie jest uruchamiane.";
    t[2698] = "Current";
    t[2699] = "Bie\u017c\u0105cy";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Strona internetowa hostowana w sieci I2P. Domy\u015blnie skonfigurowany i uruchomiony jest serwer sieciowy Jetty na <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Mo\u017ce by\u0107 wy\u0142\u0105czony lub zmieniony w <a href=/i2ptunnelmgr> Mened\u017cerze tuneli </a>. Mo\u017cna go r\u00f3wnie\u017c skonfigurowa\u0107, aby wi\u0105za\u0142 si\u0119 z konkretnym interfejsem lub wszystkimi interfejsami.";
