    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Tutaj mo\u017cesz utworzy\u0107 now\u0105 rodzin\u0119 router\u00f3w. Po utworzeniu rodziny mo\u017cesz wyeksportowa\u0107 plik klucza rodziny i udost\u0119pni\u0107 go innym routerom w nominowanej rodzinie.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Partner tuneli zgodzi\u0142 si\u0119 wzi\u0105\u0107 w nim udzia\u0142";
    t[2758] = "Advanced Lookup";
    t[2759] = "Wyszukiwanie zaawansowane";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Aby uzyska\u0107 dost\u0119p do stron internetowych hostowanych na I2P i opcjonalnie u\u017cywa\u0107 domy\u015blnego wyj\u015bciowego proxy do \u0142\u0105czenia si\u0119 z witrynami w czystej sieci, musisz skonfigurowa\u0107 przegl\u0105dark\u0119 internetow\u0105, aby korzysta\u0142a z proxy HTTP I2P, kt\u00f3re domy\u015blnie dzia\u0142a na <code>127.0.0.1 port 4444</code>. Wi\u0119kszo\u015b\u0107 przegl\u0105darek oferuje mo\u017cliwo\u015b\u0107 konfiguracji proxy. W tym mini-tutorialu skupimy si\u0119 na Firefoxie.";
    t[2776] = "Close to us";
    t[2777] = "Blisko nas";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "Mapa witryny routera I2P+";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Pobrana wtyczka w wersji {0} nie jest nowsza od zainstalowanej wtyczki";
    t[2796] = "Streaming radio service";
    t[2797] = "Us\u0142uga transmisji strumieniowej radia";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ dzia\u0142a najlepiej, gdy precyzyjnie odzwierciedlasz pr\u0119dko\u015b\u0107 swojego po\u0142\u0105czenia sieciowego w sekcji konfiguracji <a href=/config>przepustowo\u015bci</a>. Domy\u015blnie I2P+ jest skonfigurowany z do\u015b\u0107 zachowawczymi warto\u015bciami, kt\u00f3re nie b\u0119d\u0105 odpowiednie dla wielu przypadk\u00f3w u\u017cycia, dlatego prosz\u0119 po\u015bwi\u0119\u0107 troch\u0119 czasu na przegl\u0105danie tych ustawie\u0144 i popraw je tam, gdzie jest to konieczne. Im wi\u0119ksz\u0105 przepustowo\u015b\u0107 przydzielisz, <i>w szczeg\u00f3lno\u015bci</i> przepustowo\u015b\u0107 w kierunku przesy\u0142ania, tym bardziej b\u0119dziesz korzysta\u0107 z sieci.";
