    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "Pr\u00f3g, kt\u00f3ry je\u015bli zostanie przekroczony, spowoduje zarejestrowanie naruszaj\u0105cego zdalnego miejsca docelowego w okre\u015blonym pliku";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "Dzieje si\u0119 to zazwyczaj z powodu konfliktu na porcie 7654. Sprawd\u017a logi, by to zweryfikowa\u0107.";
