    t[2955] = "Informacje o routerze s\u0105 niedost\u0119pne";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Poni\u017csze aplikacje Java uruchamiane s\u0105 przez klienta webConsole i dzia\u0142aj\u0105 w tej samej JVM, co w\u0119ze\u0142. Zwykle s\u0105 aplikacjami dost\u0119pnymi przez konsol\u0119 w\u0119z\u0142a. Mog\u0105 by\u0107 kompletnymi aplikacjami (np. i2psnark), aplikacjami czo\u0142owymi do innego klienta, aplikacjami, kt\u00f3re musz\u0105 zosta\u0107 oddzielnie uruchomione (np. susidns, i2ptunnel) lub nie posiada\u0107 wcale interfejsu (np. ksi\u0105\u017cka adresowa).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "OSTRZE\u017bENIE \u2014 Tunele przychodz\u0105ce z zerowym przeskokiem nie s\u0105 zalecane w przypadku ukrytych router\u00f3w.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP Proxy";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "To jest ca\u0142kowita liczba partner\u00f3w, kt\u00f3rych zna tw\u00f3j router. S\u0105 one wymienione na <a href='/netdb'>stronie Bazy danych sieci</a>. Mo\u017ce to wynosi\u0107 od poni\u017cej 100 do 1000 lub wi\u0119cej. Ta liczba nie jest ca\u0142kowitym rozmiarem sieci; mo\u017ce znacznie si\u0119 r\u00f3\u017cni\u0107 w zale\u017cno\u015bci od ca\u0142kowitej przepustowo\u015bci, udost\u0119pnionej przepustowo\u015bci i generowanego lokalnie ruchu. I2P nie wymaga, aby router zna\u0142 ka\u017cdy inny router w sieci.";
