    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Mo\u017cesz zmieni\u0107 <a href=http://127.0.0.1:7658/help/images/>domy\u015blne wygl\u0105d</a> listy katalog\u00f3w, dostarczaj\u0105c edytowany plik <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> do ustawienia globalnego wygl\u0105du. Nale\u017cy zauwa\u017cy\u0107, \u017ce ten plik nie b\u0119dzie wy\u015bwietlany na li\u015bcie katalog\u00f3w serwera WWW. Pliki i katalogi zaczynaj\u0105ce si\u0119 od kropki (.) oraz pliki o nazwie favicon.ico oraz pliki ko\u0144cz\u0105ce si\u0119 na ~, .bak lub .old r\u00f3wnie\u017c b\u0119d\u0105 ukryte (cho\u0107 nadal dost\u0119pne). Uwaga: Aby utworzy\u0107 ukryte pliki z prefiksem . na systemie Windows, dodaj kropk\u0119 (.) na ko\u0144cu nazwy pliku lub katalogu, np. <code>.ukryty.</code>; Eksplorator Windows zapisze wtedy plik pod prawid\u0142ow\u0105 nazw\u0105, usuwaj\u0105c kropk\u0119 na ko\u0144cu w trakcie zapisu.";
