    t[3160] = "This is a shortened version of the official FAQ. For the full version, please visit <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> or <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>.";
    t[3161] = "To jest skr\u00f3cona wersja oficjalnego FAQ. Aby zobaczy\u0107 pe\u0142n\u0105 wersj\u0119, prosz\u0119 odwiedzi\u0107: <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> lub <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>.";
    t[3166] = "Total number of tunnels in use";
    t[3167] = "Ca\u0142kowita liczba u\u017cywanych tuneli";
    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Po ustawieniu na true, w konsoli zostanie w\u0142\u0105czona dodatkowa funkcjonalno\u015b\u0107, a u\u017cytkownik b\u0119dzie m\u00f3g\u0142 edytowa\u0107 ustawienia bezpo\u015brednio na stronie <a href=/configadvanced>Ustawienia Zaawansowane</a>. W sekcji <a href=/netdb>Baza Danych Sieciowych</a> b\u0119d\u0105 dost\u0119pne dodatkowe opcje wy\u015bwietlania, w tym narz\u0119dzie <a href='/netdb?f=3'>Analiza Sybil</a>, a na stronie <a href=/configclients>Konfiguracja Klient\u00f3w</a> b\u0119d\u0105 dost\u0119pne dodatkowe opcje konfiguracji. To tak\u017ce umo\u017cliwi instalacj\u0119 niepodpisanych aktualizacji, r\u0119czn\u0105 konfiguracj\u0119 adresu URL wiadomo\u015bci i dodatkowe sekcje na bocznym pasku.";
