    t[3482] = "This setting determines whether stats about our router are sporadically published to the NetDb. [Default is false]";
    t[3483] = "Ustawienie to okre\u015bla, czy statystyki dotycz\u0105ce naszego routera s\u0105 okazjonalnie publikowane w bazie danych sieci. [Domy\u015blnie warto\u015b\u0107 wynosi false]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "To jest liczba partner\u00f3w, kt\u00f3rych router ma do dyspozycji do budowy tuneli klienta. Zazwyczaj mie\u015bci si\u0119 w przedziale od 8 do 30. Twoi szybcy partnerzy s\u0105 wy\u015bwietlani na <a href='/profiles'>stronie Profili</a>. <a href='/configstats#router.fastPeers'>[W\u0142\u0105cz wykresy]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Kliknij przycisk <i>Prze\u0142\u0105cz z pliku</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Wariant routingu cebulowego, kt\u00f3ry szyfruje wiele wiadomo\u015bci razem, aby utrudni\u0107 atakuj\u0105cym analiz\u0119 ruchu i zwi\u0119kszy\u0107 pr\u0119dko\u015b\u0107 transferu danych. Aby uzyska\u0107 wi\u0119cej informacji, zobacz <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>dokumentacj\u0119 online</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Jak wzmocni\u0107 witryn\u0119 WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "Wn\u0119trzno\u015bci I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Domy\u015blnie I2P jest dostarczany z serwerem WWW, kt\u00f3ry pozwala na hostowanie w\u0142asnej anonimowej strony internetowej (tradycyjnie nazywanej <i>eepsite</i>). Zar\u00f3wno strona, jak i Konsola Routera I2P dzia\u0142aj\u0105 na zoptymalizowanej wersji serwera <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, dostosowanej do I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Ustawienie to umo\u017cliwia wykluczenie starszych router\u00f3w z bazy danych sieci. Routery starsze ni\u017c domy\u015blne lub warto\u015b\u0107 przez Ciebie ustawiona zostan\u0105 usuni\u0119te z bazy danych sieci i zbanowane na czas trwania sesji routera. Domy\u015blnie, routery starsze ni\u017c 0.9.20 s\u0105 wykluczone. Uwaga: pocz\u0105wszy od wersji I2P+ 0.9.46+, do budowy tuneli lokalnych u\u017cywane s\u0105 tylko routery dzia\u0142aj\u0105ce na bardzo nowych wersjach. [Wymaga ponownego uruchomienia]";
