    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "To ustawienie, w milisekundach, przes\u0142ania domy\u015blny limit czasu przetwarzania wiadomo\u015bci (wskazany jako <i>Op\u00f3\u017anienie wiadomo\u015bci</i> w sekcji bocznego paska Zat\u0142oczenia) przed ustaleniem, \u017ce router jest przeci\u0105\u017cony i pr\u00f3\u015bby o przepuszczenie tunelu s\u0105 odrzucane. [Domy\u015blnie 750ms lub 1500ms, je\u015bli router jest oznaczony jako wolny]";
