    t[3639] = "UDP wychodz\u0105ce na porcie 123, zezwalaj\u0105ce na odpowiedzi: jest to konieczne dla wewn\u0119trznej synchronizacji czasu I2P (poprzez questioning losowego hosta SNTP w <code>pool.ntp.org</code> lub <a href=/help/advancedsettings#ntpserverconfig>innego okre\u015blonego przez Ciebie serwera</a>).";
    t[3646] = "NetDb Search";
    t[3647] = "Wyszukiwanie NetDb";
    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
