    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Poni\u017csze opcje konfiguracji routera nie s\u0105 dost\u0119pne w interfejsie u\u017cytkownika, zwykle dlatego, \u017ce s\u0105 rzadko u\u017cywane lub umo\u017cliwiaj\u0105 dost\u0119p do zaawansowanych ustawie\u0144, kt\u00f3rych wi\u0119kszo\u015b\u0107 u\u017cytkownik\u00f3w nie b\u0119dzie potrzebowa\u0107. To nie jest wyczerpuj\u0105ca lista. Niekt\u00f3re ustawienia b\u0119d\u0105 wymaga\u0142y restartu routera, aby zacz\u0119\u0142y obowi\u0105zywa\u0107. Zwr\u00f3\u0107 uwag\u0119, \u017ce wszystkie ustawienia s\u0105 rozr\u00f3\u017cniane ze wzgl\u0119du na wielko\u015b\u0107 liter. Aby doda\u0107 opcje, nale\u017cy edytowa\u0107 plik <code>router.config</code>, lub, po dodaniu <code>routerconsole.advanced=true</code> do pliku <code>router.config</code>, mo\u017cna edytowa\u0107 ustawienia w konsoli na stronie <a href=/configadvanced>Ustawienia Zaawansowane</a>.";
