    t[3961] = "Niedawno zako\u0144czone zadania";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Niekt\u00f3re klienty IRC s\u0105 skonfigurowane do roz\u0142\u0105czania si\u0119 z serwerem, je\u015bli nie nawi\u0105\u017c\u0105 z nim komunikacji przez okre\u015blony czas, co czasami mo\u017ce sprawia\u0107 problemy dla I2P IRC, je\u015bli warto\u015b\u0107 <i>ping timeout</i> jest ustawiona zbyt nisko. Ustalenie warto\u015bci ping timeout w Twoim kliencie na wysok\u0105 warto\u015b\u0107 (np. 320 sekundy) cz\u0119sto spowoduje bardziej stabilne po\u0142\u0105czenie z sieci\u0105. W hexchat mo\u017cna to skonfigurowa\u0107, wpisuj\u0105c <code>/set net_ping_timeout 320</code>. Spowoduje to zapisanie warto\u015bci w pliku <code>hexchat.conf</code>.";
    t[3964] = "Run at Startup?";
    t[3965] = "Uruchomi\u0107 podczas startu?";
    t[3972] = "Never";
    t[3973] = "Nigdy";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Konfiguracja opcjonalna, kt\u00f3ra automatycznie zmienia twoj\u0105 <a href=/netdb?r=.>to\u017csamo\u015b\u0107 routera</a> oraz <a href=/confignet#udpconfig>zewn\u0119trzny port</a>, gdy zmienia si\u0119 publiczny adres IP twojego systemu. Dzia\u0142a to zabezpieczaj\u0105co w przypadkach, gdy tw\u00f3j adres IP mo\u017ce cz\u0119sto si\u0119 zmienia\u0107, na przyk\u0142ad gdy korzystasz z I2P na laptopie z wielu lokalizacji, uniemo\u017cliwiaj\u0105c przeciwnikowi skorelowanie twojej to\u017csamo\u015bci routera z adresem IP.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Ruter nie jest skonfigurowany, by udost\u0119pnia\u0107 swoje adresy, zatem nie spodziewa si\u0119 te\u017c nadchodz\u0105cych po\u0142\u0105cze\u0144.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "Aplikacja wiersza polece\u0144 dostarczana z I2P+ (Linux/MacOS), kt\u00f3ra jest u\u017cywana do wykonania \u017c\u0105dania <code>head</code> w okre\u015blonym zasobie http w sieci, zwracaj\u0105c r\u00f3\u017cne nag\u0142\u00f3wki odpowiedzi z serwera zdalnego. Domy\u015blnie eephead u\u017cywa serwera proxy HTTP na <code>127.0.0.1:4444</code>.";
