    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "Aby uzyska\u0107 dost\u0119p do stron internetowych hostowanych w sieci I2P i opcjonalnie u\u017cywa\u0107 domy\u015blnego outproxy do \u0142\u0105czenia si\u0119 ze stronami internetowymi na clearnet, musisz skonfigurowa\u0107 swoj\u0105 przegl\u0105dark\u0119 do u\u017cycia I2P+ <b>HTTP</b> proxy, domy\u015blnie dzia\u0142aj\u0105cego na <code>127.0.0.1 port 4444</code>. Aby uzyska\u0107 wi\u0119cej pomocy, zobacz <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>przewodnik konfiguracji</a>, lub <a href=/help/configuration#browserconfig>wskaz\u00f3wki dla Firefox</a>.";
