    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "Wersja oprogramowania I2P, kt\u00f3r\u0105 aktualnie u\u017cywasz. Je\u015bli dost\u0119pna jest nowa wersja, zostaniesz o tym poinformowany na panelu bocznym. Zaleca si\u0119 aktualizowanie routera, aby zapewni\u0107 optymaln\u0105 wydajno\u015b\u0107 i bezpiecze\u0144stwo. Aktualizacje routera s\u0105 zazwyczaj udost\u0119pniane \u015brednio co 2-3 miesi\u0105ce.";
