    t[4696] = "Prefer IPv4 over IPv6";
    t[4697] = "Preferuj IPv4 nad IPv6";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (oparte na NIO TCP) i NTCP2 to oparte na TCP transporty sieciowe, kt\u00f3re korzystaj\u0105 z implementacji TCP Java NIO (New I/O) do dostarczania wiadomo\u015bci I2NP mi\u0119dzy routerami w sieci. NTCP2 zwi\u0119ksza odporno\u015b\u0107 NTCP na r\u00f3\u017cne ataki i metody automatycznego identyfikowania ruchu. Aby uzyska\u0107 wi\u0119cej informacji, zobacz <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>dokumentacj\u0119 online</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Mo\u017cna u\u017cy\u0107 rekordera do rejestrowania miejsc docelowych agresywnych klient\u00f3w w okre\u015blonym pliku, a nast\u0119pnie u\u017cy\u0107 tego samego pliku do ich ograniczenia. Poni\u017cszy fragment kodu definiuje filtr, kt\u00f3ry pocz\u0105tkowo zezwala na wszystkie \u017c\u0105dania po\u0142\u0105cze\u0144, ale je\u015bli jakie\u015b pojedyncze miejsce docelowe przekracza 180 \u017c\u0105da\u0144 w ci\u0105gu 60 sekund, zostanie ograniczone do 30 \u017c\u0105da\u0144 co 60 sekund:";
