    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "To ustawienie, gdy skonfigurowane z \u015bcie\u017ck\u0105 wskazuj\u0105c\u0105 na wa\u017cny plik listy blokowanych, umo\u017cliwia dodatkow\u0105 list\u0119 blokowanych, skonfigurowan\u0105 przez u\u017cytkownika, do za\u0142adowania przy uruchamianiu routera. [Domy\u015blnie wy\u0142\u0105czone, wymagane ponowne uruchomienie]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ obs\u0142uguje niestandardowe zmiany motyw\u00f3w dla konsoli, mened\u017cera tuneli, I2PSnark, SusiDNS i Susimail, umo\u017cliwiaj\u0105c zmiany motyw\u00f3w, kt\u00f3re s\u0105 trwa\u0142e po aktualizacjach. Aby aktywowa\u0107 zmian\u0119, utw\u00f3rz plik CSS o nazwie <code>override.css</code> z modyfikacjami motywu i umie\u015b\u0107 go w odpowiednim katalogu motywu, kt\u00f3re chcesz zmieni\u0107 lub zmie\u0144 nazw\u0119 jednego z plik\u00f3w przyk\u0142adowych, a nast\u0119pnie wykonaj pe\u0142ne od\u015bwie\u017cenie przegl\u0105darki. Nale\u017cy pami\u0119ta\u0107, \u017ce mened\u017cer tuneli i konsola korzystaj\u0105 z tego samego pliku <code>override.css</code>. Aby dezaktywowa\u0107 zmian\u0119, usu\u0144 lub zmie\u0144 nazw\u0119 pliku <code>override.css</code>, a nast\u0119pnie wykonaj pe\u0142ne od\u015bwie\u017cenie przegl\u0105darki (zwykle Control + Shift + R).";
