    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Je\u017celi po kilku minutach dzia\u0142ania twojego routera, liczba <b>Aktywnych W\u0119z\u0142\u00f3w</b> i <b>Znanych W\u0119z\u0142\u00f3w</b> wynosi 0, a w pasku po prawej stronie pojawia si\u0119 powiadomienie, \u017ce musisz sprawdzi\u0107 swoje po\u0142\u0105czenie sieciowe, sprawd\u017a, czy masz dost\u0119p do Internetu. Je\u017celi po\u0142\u0105czenie internetowe dzia\u0142a prawid\u0142owo, mo\u017ce by\u0107 konieczne odblokowanie Javy w twoim firewallu. W przeciwnym przypadku konieczne mo\u017ce by\u0107 \u201ezape\u0142nienie\u201d ponowne twojego routera I2P. Odwied\u017a stron\u0119 <a href=/configreseed#reseedconfig>Konfiguracja Wydawania W\u0119z\u0142\u00f3w</a> i kliknij przycisk <i>Zapisz Zmiany i Zape\u0142nij Ponownie Teraz</i>. Aby uzyska\u0107 wi\u0119cej informacji, zobacz sekcj\u0119 <a href=#reseedhelp>Pomoc w Zape\u0142nianiu</a> powy\u017cej.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Wy\u017cszy poziom API socket\u00f3w dla klient\u00f3w. Otwierany tylko wtedy, gdy klient SAM V3 \u017c\u0105da sesji UDP. Mo\u017ce zosta\u0107 w\u0142\u0105czony/wy\u0142\u0105czony na <a href=/configclients>stronie Konfiguracja Klienta</a>. Mo\u017ce by\u0107 zmieniony w pliku <code>clients.config</code> za pomoc\u0105 opcji wiersza polece\u0144 SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Je\u015bli chcesz, aby Twoja witryna dzia\u0142a\u0142a responsywnie, kompresja obraz\u00f3w jest niezb\u0119dna podczas hostowania du\u017cych obraz\u00f3w. Korzystanie z us\u0142ugi takiej jak <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> do kompresowania obraz\u00f3w png i jpeg cz\u0119sto prowadzi do znacznie mniejszych plik\u00f3w z minimaln\u0105 utrat\u0105 jako\u015bci. W niekt\u00f3rych sytuacjach format webp mo\u017ce zast\u0105pi\u0107 jpegi, generuj\u0105c mniejsze pliki o zbli\u017conej lub lepszej wierno\u015bci wizualnej, a tak\u017ce ciesz\u0105cy si\u0119 du\u017cym wsparciem przegl\u0105darek. Rozwa\u017c r\u00f3wnie\u017c u\u017cycie plik\u00f3w .svg zamiast map bitowych dla ikon i ilustracji - zwykle s\u0105 one mniejsze ni\u017c odpowiedni plik mapy bitowej (prze\u015blij je przez us\u0142ug\u0119 tak\u0105 jak <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> w celu usuni\u0119cia zb\u0119dnych danych), skaluj\u0105 si\u0119 bez utraty jako\u015bci i mog\u0105 by\u0107 \u015bci\u015bni\u0119te przez serwer.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP wy\u0142\u0105czone w urz\u0105dzeniu";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Domy\u015blnie wi\u0119kszo\u015b\u0107 twoich us\u0142ug klient\u00f3w (poczta, serwer proxy HTTP, IRC) b\u0119dzie korzysta\u0107 z tego samego zestawu tuneli (ze wzgl\u0119d\u00f3w wydajno\u015bciowych) i b\u0119d\u0105 wymienione jako <i>Wsp\u00f3\u0142dzielone Klienty</i> i <i>Wsp\u00f3\u0142dzielone Klienty(DSA)</i> na pasku bocznym w sekcji Tunnels dla us\u0142ugi i na stronie <a href=/tunnels>Tunnels</a>.";
