    t[5685] = "Sprawd\u017a, czy inny program nie u\u017cywa wybranego portu. Je\u017celi tak, to zatrzymaj ten program lub skonfiguruj I2P aby u\u017cywa\u0142 innego portu.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "R\u0119cznie edytuj peer\u00f3w i przegl\u0105daj zablokowanych peer\u00f3w oraz list\u0119 zablokowanych";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Zapora sieciowa z w\u0142\u0105czonym przychodz\u0105cym protoko\u0142em TCP";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Otw\u00f3rz <a href=/confignet#udpconfig>port I2P+</a> na modemie, routerze i/lub firewalls dla lepszego po\u0142\u0105czenia (optymalnie zar\u00f3wno UDP, jak i TCP). Wi\u0119cej informacji na temat przekierowywania port\u00f3w mo\u017cna znale\u017a\u0107 na stronie <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, a tak\u017ce na naszych forach i kana\u0142ach IRC wymienionych poni\u017cej. Nale\u017cy zauwa\u017cy\u0107, \u017ce I2P nie obs\u0142uguje \u0142\u0105czenia si\u0119 z internetem za po\u015brednictwem proxy typu http ani socks [zaakceptujemy \u0142atki!], chocia\u017c mo\u017cna \u0142\u0105czy\u0107 si\u0119 z serwerami proxy za po\u015brednictwem samego I2P po\u0142\u0105czonego z sieci\u0105.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Filtr tunelu mo\u017ce zapewni\u0107 ochron\u0119 przed atakami typu odmowa us\u0142ugi, bez przerywania dzia\u0142ania us\u0142ugi dla prawdziwych u\u017cytkownik\u00f3w, zar\u00f3wno w po\u0142\u0105czeniu z ograniczeniem przepustowo\u015bci tunelu, jak i jako alternatywna strategia. Mo\u017ce r\u00f3wnie\u017c s\u0142u\u017cy\u0107 do rejestrowania dost\u0119pu do hostowanej us\u0142ugi, aby sprawdzi\u0107, czy serwer jest atakowany, lub po prostu do logowania wszystkich odwiedzaj\u0105cych wed\u0142ug lokalizacji I2P. Ponadto, filtr mo\u017ce dzia\u0142a\u0107 jednocze\u015bnie jako bia\u0142a i czarna lista, co czyni go bardziej elastycznym ni\u017c kontrolki listy dost\u0119pu Mened\u017cera tuneli. Zauwa\u017c, \u017ce wiele tuneli serwera mo\u017ce dzieli\u0107 pojedynczy plik filtru, je\u015bli chcesz zastosowa\u0107 filtr globalny.";
