    t[6025] = "Strona docelowa dla r\u00f3\u017cnych us\u0142ug";
    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "To ustawienie (w milisekundach) pozwala na r\u0119czn\u0105 konfiguracj\u0119 op\u00f3\u017anienia mi\u0119dzy aktualizacjami od\u015bwie\u017cania routera, uruchamianymi przez zadanie Refresh Routers. Domy\u015blnie przerwa mi\u0119dzy od\u015bwie\u017caniami zale\u017cy od rozmiaru bazy danych sieci i wprowadza pewn\u0105 losowo\u015b\u0107 w timing, aby zmniejszy\u0107 analiz\u0119 ruchu. Dla warto\u015bci mniejszych ni\u017c 2000 milisekund, zaleca si\u0119 zwi\u0119kszenie warto\u015bci <code>router.refreshTimeout</code>. Zwr\u00f3\u0107 uwag\u0119, \u017ce ustawienie tej warto\u015bci poni\u017cej 2000 milisekund zwi\u0119kszy ruch w twojej sieci i mo\u017ce spowodowa\u0107 op\u00f3\u017anienie zadania, co nie jest zalecane do ci\u0105g\u0142ego u\u017cytku.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Tunele serwera, konfigurowalne w <a href=/i2ptunnelmgr>Mened\u017cerze tuneli</a>, zapewniaj\u0105 wiele sposob\u00f3w ograniczenia dost\u0119pu do hostowanego us\u0142ugi. Bia\u0142e i czarne listy docelowego ruchu, ograniczanie po\u0142\u0105cze\u0144 i filtrowanie tuneli to metody dost\u0119pne do zwalczania atak\u00f3w typu odmowa us\u0142ugi, udzielanie wy\u0142\u0105cznego dost\u0119pu do znanych lokalizacji I2P i zarz\u0105dzanie ruchem do serwera.";
