    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Nie ujawniaj tego pliku nieznajomym u\u017cytkownikom, poniewa\u017c zawiera on wra\u017cliwe dane (100 plik\u00f3w RouterInfo) z Twojego w\u0142asnego routera I2P, kt\u00f3re potencjalnie mog\u0142yby zosta\u0107 wykorzystane przez przeciwnika do ods\u0142oni\u0119cia Twojej to\u017csamo\u015bci. W celu ochrony swojej anonimowo\u015bci powiniene\u015b zaczeka\u0107 kilka godzin/dni przed podzieleniem si\u0119 plikiem ze swoim zaufanym znajomym. Zaleca si\u0119 r\u00f3wnie\u017c oszcz\u0119dne korzystanie z tej procedury (nie cz\u0119\u015bciej ni\u017c raz w tygodniu).";
