    t[6351] = "Ta opcja okre\u015bla liczb\u0119 r\u00f3wnoczesnych pr\u00f3b eksplorowania, jakie zostan\u0105 przeprowadzone podczas wykonywania zadania eksploracji dla r\u00f3wnolegle dzia\u0142aj\u0105cych par. [Domy\u015blnie 1 para na raz, gdy jest znanych wi\u0119cej ni\u017c 3000 par]. Zauwa\u017c, \u017ce zwi\u0119kszenie tej warto\u015bci zwi\u0119kszy zapotrzebowanie na przepustowo\u015b\u0107 dla eksploracji, a ustalenie zbyt wysokiej warto\u015bci mo\u017ce powodowa\u0107 nadmierne op\u00f3\u017anienia wiadomo\u015bci i wp\u0142ywa\u0107 na inne us\u0142ugi, wi\u0119c korzystaj z ostro\u017cno\u015bci!";
