    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Uwaga: Aby zwi\u0119kszy\u0107 bezpiecze\u0144stwo podczas przegl\u0105dania stron .i2p, warto rozwa\u017cy\u0107 zainstalowanie rozszerzenia, takiego jak <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, kt\u00f3re blokuje skrypty Javascript w przegl\u0105darce. Jednak zaleca si\u0119 dodanie adresu, na kt\u00f3rym dzia\u0142a I2P+, do zaufanych adres\u00f3w w celu w\u0142\u0105czenia r\u00f3\u017cnych ulepsze\u0144 konsoli routerowej. Ponadto zalecane jest tak\u017ce zainstalowanie dodatku, kt\u00f3ry blokuje \u017c\u0105dania do zewn\u0119trznych zasob\u00f3w, na przyk\u0142ad <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
