    t[6760] = "Click Restart to install";
    t[6761] = "Kliknij Restart by zainstalowa\u0107";
    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ mo\u017ce by\u0107 powolne w\u0142\u0105czanie do sieci za pierwszym razem po uruchomieniu, poniewa\u017c rozpoczyna bootstrapping w sieci i dowiaduje si\u0119 o dodatkowych w\u0119z\u0142ach. Im d\u0142u\u017cej dzia\u0142a tw\u00f3j router I2P+, tym lepiej dzia\u0142a, dlatego staraj si\u0119 go trzyma\u0107 w\u0142\u0105czonego tak d\u0142ugo, jak to mo\u017cliwe, najlepiej 24 godziny na dob\u0119, 7 dni w tygodniu. Je\u015bli po 30 minutach liczba <i>Aktywnych: [po\u0142\u0105czonych/ostatnich]</i> jest nadal mniejsza ni\u017c 10 w\u0119z\u0142\u00f3w, lub ca\u0142kowita liczba <i>Zintegrowanych</i> w\u0119z\u0142\u00f3w jest mniejsza ni\u017c 5, istnieje kilka rzeczy, kt\u00f3re mo\u017cesz sprawdzi\u0107 w przypadku problem\u00f3w:";
