    t[6943] = "Wysokiej przepustowo\u015bci";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Javaowa implementacja klienta Tor, dost\u0119pna jako wtyczka I2P. Mo\u017ce by\u0107 u\u017cywana jako domy\u015blny <i>outproxy</i>, je\u015bli skonfigurowana w odpowiednim tunelu SOCKS lub HTTP klienta w <i>Mened\u017cerze tuneli</i>. Dost\u0119pna na <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Kod \u017ar\u00f3d\u0142owy jest dost\u0119pny na <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Adresy IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Ta sekcja wskazuje \u015brednie pr\u0119dko\u015bci przepustowo\u015bci oraz ca\u0142kowite wykorzystanie w bie\u017c\u0105cej sesji. Wszystkie warto\u015bci s\u0105 podawane w bajtach na sekund\u0119. Ograniczenia przepustowo\u015bci mo\u017cna zmieni\u0107 na <a href='/config'>stronie konfiguracji przepustowo\u015bci</a>. Im wi\u0119cej przepustowo\u015bci udost\u0119pnisz, tym bardziej pomagasz sieci i poprawiasz w\u0142asn\u0105 anonimowo\u015b\u0107, dlatego prosz\u0119 po\u015bwi\u0119ci\u0107 czas na sprawdzenie ustawie\u0144. Je\u015bli nie jeste\u015b pewien pr\u0119dko\u015bci swojej sieci, skorzystanie z us\u0142ugi takiej jak <a href='http://speedtest.net/'>SpeedTest</a> lub podobnej, da ci dobry pogl\u0105d na mo\u017cliwo\u015bci przepustowo\u015bci. Ilo\u015b\u0107 udost\u0119pnianej przepustowo\u015bci poci\u0105ga za sob\u0105 (KBps) wyznaczenie twojego og\u00f3lnego wk\u0142adu w sie\u0107. Przepustowo\u015b\u0107 jest domy\u015blnie <a href='/graphs'>zaprezentowana na wykresie</a>.";
