    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Te ustawienie pozwala skonfigurowa\u0107 minimaln\u0105 liczb\u0119 hostowanych tuneli uczestnicz\u0105cych, zanim router zacznie odrzuca\u0107 \u017c\u0105dania tuneli na podstawie przewidywanych wymaga\u0144 dotycz\u0105cych przepustowo\u015bci. [Warto\u015b\u0107 domy\u015blna to 100, je\u015bli system dzia\u0142a na platformie Android, 800, je\u015bli system dzia\u0142a na platformie ARM i jest dost\u0119pnych mniej ni\u017c 4 rdzenie, 1200, je\u015bli system dzia\u0142a na platformie ARM i jest dost\u0119pnych 4 lub wi\u0119cej rdzeni, w przeciwnym przypadku 2500]";
