    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P nie dzia\u0142\u0105 dobrze za tego typu zaporami. Prawdopodobnie nie b\u0119dzie przyjmowa\u0142o po\u0142\u0105cze\u0144 przychodz\u0105cych, co zmniejszy Twoje uczestnictwo w sieci.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Protok\u00f3\u0142 Klienta I2P (I2CP) umo\u017cliwia zewn\u0119trznym aplikacjom (klientom) komunikacj\u0119 z I2P za po\u015brednictwem jednego gniazda TCP, domy\u015blnie u\u017cywaj\u0105c portu 7654. Aby uzyska\u0107 wi\u0119cej informacji, zobacz <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>dokumentacj\u0119 online</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "Suma kolejki";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "To ustawienie okre\u015bla, kt\u00f3re po\u0142\u0105czenie ma priorytet podczas komunikacji z innymi w\u0119z\u0142ami. Domy\u015blnie NTCP ma priorytet przed UDP (SSU). Ustawienie warto\u015bci na true spowoduje, \u017ce UDP b\u0119dzie priorytetowe, chyba \u017ce istnieje ju\u017c istniej\u0105ce po\u0142\u0105czenie NTCP; gdy ustawione na always, zawsze u\u017cywane b\u0119dzie UDP, niezale\u017cnie od istniej\u0105cego po\u0142\u0105czenia NTCP. [Warto\u015b\u0107 domy\u015blna to false]";
