    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 tylko SSU, przedstawiciele";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) to spos\u00f3b komunikacji w sieci I2P, kt\u00f3ry zapewnia szyfrowane, zorientowane na po\u0142\u0105czenie, punkt-do-punktowe po\u0142\u0105czenia, a tak\u017ce us\u0142ugi wykrywania adresu IP i transmisji NAT. Aby uzyska\u0107 wi\u0119cej informacji, zobacz <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>dokumentacj\u0119 online</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Okno przeci\u0105\u017cenia";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "U\u017cyj serwera proxy do ponownego wys\u0142ania";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Do czasu integracji I2P w <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a> nie by\u0142o mo\u017cliwe pobieranie torrent\u00f3w, kt\u00f3re nie by\u0142y hostowane na sieci I2P. Jednak teraz, gdy Vuze (a ostatnio <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) umo\u017cliwiaj\u0105 u\u017cytkownikom udost\u0119pnianie nie-I2P torrent\u00f3w na I2P, nie-I2P torrenty mo\u017cna pobiera\u0107 przez I2P, je\u015bli u\u017cytkownicy Vuze/Bigly postanowili udost\u0119pni\u0107 tre\u015b\u0107 sieci I2P. Popularne torrenty z du\u017c\u0105 liczb\u0105 peer\u00f3w s\u0105 bardziej dost\u0119pne za po\u015brednictwem I2P; aby sprawdzi\u0107, czy dana zawarto\u015b\u0107 jest dost\u0119pna, dodaj link do torrenta, magnes lub infohash do swojego klienta BitTorrent obs\u0142uguj\u0105cego I2P.";
