    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Je\u015bli zostanie poproszony o ci\u0105g <i>Autoryzacja rejestracji</i>, mo\u017cna go znale\u017a\u0107 na stronie <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'> Strona autoryzacji rejestracji </a> po\u0142\u0105czona z <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'> Strona konfiguracji mened\u017cera tuneli </a>. Autoryzacja rejestracji zapewnia, \u017ce tylko w\u0142a\u015bciciel mo\u017ce zarejestrowa\u0107 lub w inny spos\u00f3b zarz\u0105dza\u0107 nazw\u0105 hosta, i jest wymagana na statystykach. i2p i reg.i2p. ";
    t[7448] = "News &amp; Updates";
    t[7449] = "Wiadomo\u015bci i aktualizacje";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Je\u017celi nie mo\u017cesz uruchomi\u0107 routera za pomoc\u0105 polecenia <code>i2p/i2prouter start</code>, spr\u00f3buj skryptu <code>runplain.sh</code> w tym samym katalogu. Nigdy nie s\u0105 wymagane uprawnienia administratora do uruchomienia I2P+. Je\u017celi musisz skompilowa\u0107 <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (co jest rzadko potrzebne), skonsultuj dokumentacj\u0119, odwied\u017a fora lub odwied\u017a <a href=irc://127.0.0.1:6668/saltR class=chatlink>kana\u0142 I2P+</a> lub <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>kana\u0142 deweloper\u00f3w IRC</a>.";
