    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Informacje definiuj\u0105ce unikaln\u0105 to\u017csamo\u015b\u0107 routera w sieci, kt\u00f3re obejmuj\u0105 jego adres IP (lub adresy IP po\u015brednich wprowadzaczy) oraz port nas\u0142uchu, klucze publiczne do podpisywania i szyfrowania. To\u017csamo\u015bci router\u00f3w koreluj\u0105 z peerami w NetDB. Nazywane r\u00f3wnie\u017c <i>RouterInfo</i>.";
