    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Rozproszona baza danych zawieraj\u0105ca informacje kontaktowe routera (RouterInfos) oraz informacje kontaktowe celu (LeaseSets). Ka\u017cdy router utrzymuje swoj\u0105 w\u0142asn\u0105 (cz\u0119\u015bciow\u0105) baz\u0119 danych w celu komunikacji z innymi routerami w sieci; \u017caden router nie b\u0119dzie utrzymywa\u0142 listy wszystkich router\u00f3w. RouterInfos s\u0105 przechowywane na dysku i odczytywane do pami\u0119ci przy starcie routera lub po uzyskaniu nowych RouterInfos. Jest r\u00f3wnie\u017c nazywana jako <i>NetDb</i>. Aby uzyska\u0107 wi\u0119cej informacji, zobacz <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>dokumentacj\u0119 online</a>.";
    t[7692] = "Address";
