    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Pr\u00f3g jest definiowany przez liczb\u0119 pr\u00f3b nawi\u0105zania po\u0142\u0105czenia, kt\u00f3re zdalne miejsce docelowe ma prawo wykona\u0107 w okre\u015blonej liczbie sekund przed wyst\u0105pieniem \"naruszenia\".";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Sie\u0107 Clearnet zazwyczaj odnosi si\u0119 do publicznie dost\u0119pnej sieci internet, przeciwstawiaj\u0105cej si\u0119 darknetowi, kt\u00f3ry zwykle opisuje zaszyfrowane, anonimowe us\u0142ugi stworzone na I2P, Tor itp. Aby uzyska\u0107 wi\u0119cej informacji, sprawd\u017a <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>artyku\u0142 w Wikipedii</a>.";
