    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Je\u015bli twoja zapora jest otwarta, a I2P dalej uwa\u017ca, \u017ce jeste\u015b za zapor\u0105 \u2013 pami\u0119taj, i\u017c mo\u017cesz mie\u0107 kilka zap\u00f3r, np. przyk\u0142ad zewn\u0119trzny sprz\u0119towy router.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "S\u0142owo kluczowe <i class=example>deny</i>. Ten pr\u00f3g zawsze b\u0119dzie naruszony, to znaczy \u017cadna pr\u00f3ba nawi\u0105zania po\u0142\u0105czenia nie b\u0119dzie dozwolona.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "rejestruj odwiedzaj\u0105cych, kt\u00f3rzy nawi\u0105zuj\u0105 90 lub wi\u0119cej po\u0142\u0105cze\u0144 na minut\u0119";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Skonfigurowa\u0142e\u015b/-a\u015b po\u0142\u0105czenia przychodz\u0105ce TCP, jednak Tw\u00f3j port UDP jest za zapor\u0105. Mo\u017ce to oznacza\u0107, \u017ce i port TCP jest chroniony.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "To jest liczba partner\u00f3w, kt\u00f3rych router b\u0119dzie wykorzystywa\u0142 do zapyta\u0144 w bazie danych sieci. S\u0105 to zwykle routery <i>floodfill</i>, kt\u00f3re s\u0105 odpowiedzialne za utrzymanie integralno\u015bci sieci. Twoi zintegrowani partnerzy s\u0105 wy\u015bwietlani na dole <a href='/profiles'>strony Profili</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Zarz\u0105dzaj aplikacjami internetowymi routera";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "TCP wychodz\u0105ce z losowych wysokich port\u00f3w do dowolnych zdalnych port\u00f3w TCP.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Uruchomienie I2P mo\u017ce zaj\u0105\u0107 troch\u0119 czasu - Tw\u00f3j w\u0119ze\u0142 musi w\u0142\u0105czy\u0107 si\u0119 do sieci (zintegrowa\u0107) i znale\u017a\u0107 innych uczestnik\u00f3w, wi\u0119c prosimy o cierpliwo\u015b\u0107.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
