    t[8334] = "Function";
    t[8335] = "Funkcja";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "W sieci I2P us\u0142ugi hostowane zdalnie mog\u0105 by\u0107 dost\u0119pne za pomoc\u0105 adresu <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> ko\u0144cz\u0105cego si\u0119 na \".b32.i2p\", <i>celu</i> przedstawionego jako d\u0142ugi ci\u0105g <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>, lub najcz\u0119\u015bciej za pomoc\u0105 domeny .i2p. Cel jest odpowiednikiem adresu IP w I2P i jest wy\u015bwietlany na <a href='/i2ptunnel/edit?tunnel=3'>stronie konfiguracji mened\u017cera tuneli</a>. Mo\u017cesz udost\u0119pnia\u0107 sw\u00f3j adres b32.i2p, aby umo\u017cliwi\u0107 innym dost\u0119p do twojej strony internetowej, dop\u00f3ki nie zarejestrujesz swojej w\u0142asnej domeny .i2p.";
