    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Aby wy\u0142\u0105czy\u0107 list\u0119 katalog\u00f3w, znajd\u017a wpis <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> w pliku <code>base-context.xml</code>, kt\u00f3ry znajduje si\u0119 w folderze <code>eepsite/contexts</code> (tu\u017c nad katalogiem docroot) i zmie\u0144 'true' na 'false' bezpo\u015brednio pod nim. Aby natychmiast zastosowa\u0107 zmian\u0119, zatrzymaj i uruchom ponownie klient <i>Serwera WWW I2P</i> na <a href=/configclients>stronie konfiguracji klienta</a>. Mo\u017cesz r\u00f3wnie\u017c umie\u015bci\u0107 pusty plik <code>index.html</code> w dowolnym udost\u0119pnionym katalogu, aby ukry\u0107 list\u0119 katalog\u00f3w dla tego miejsca.";
