    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Je\u015bli nie u\u017cywasz IE, prawdopodobnie Twoja przegl\u0105darka symuluje bycie IE. Je\u015bli chcia\u0142by\u015b mie\u0107 mo\u017cliwo\u015b\u0107 zmiany stylu konsoli, prosimy o skonfigurowanie Twojej przegl\u0105darki (lub proxy), by u\u017cywa\u0107 innego \u0142a\u0144cucha User-Agent.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "Wyszukiwarka Clearnet zorientowana na prywatno\u015b\u0107";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Dzienniki</a> mog\u0105 pom\u00f3c w rozwi\u0105zaniu problemu. Mo\u017cesz chcie\u0107 wklei\u0107 fragmenty na <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> aby otrzyma\u0107 pomoc, lub skorzysta\u0107 z <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>plitki</a> i poda\u0107 link na IRC w celu uzyskania pomocy.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Zalecanym formatem s\u0105 wtyczki podpisane kluczem kryptograficznym dewelopera, ale je\u015bli chcesz zainstalowa\u0107 niepodpisane wtyczki (.zip), mo\u017cesz ustawi\u0107 to na true. Nale\u017cy jednak zwr\u00f3ci\u0107 uwag\u0119, \u017ce wci\u0105\u017c mog\u0105 wyst\u0105pi\u0107 problemy pr\u00f3buj\u0105c zainstalowa\u0107 niepodpisan\u0105 wtyczk\u0119, je\u015bli deweloper do\u0142\u0105czy\u0142 dodatkowe sprawdzanie w procesie budowy wtyczki.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Je\u015bli uruchamiasz samodzielny egzemplarz Tora lokalnie, mo\u017cesz go u\u017cy\u0107, konfiguruj\u0105c I2P do u\u017cywania: <i>Typ proxy:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Wybierz j\u0119zyk, kt\u00f3ry b\u0119dzie u\u017cywany w konsoli rutera i aplikacjach internetowych (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrenty</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>menad\u017cer tuneli</a> itp). Je\u015bli chcesz zmieni\u0107 j\u0119zyk w przysz\u0142o\u015bci, zmieni\u0107 motyw konsoli rutera lub skonfigurowa\u0107 has\u0142o dost\u0119pu do konsoli, mo\u017cesz to zrobi\u0107 na stronie konfiguracji <a href=/configui target=_blank rel=noreferrer>interfejsu u\u017cytkownika</a>.";
