    t[9052] = "Ready";
    t[9053] = "Gotowy";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "To s\u0105 lokalne us\u0142ugi dostarczane przez tw\u00f3j router. Mog\u0105 to by\u0107 klienty uruchamiane za po\u015brednictwem <a href='/i2ptunnelmgr'>Mened\u017cera Tuneli</a> lub programy zewn\u0119trzne \u0142\u0105cz\u0105ce si\u0119 przez SAM, BOB lub bezpo\u015brednio do I2CP. Domy\u015blnie wi\u0119kszo\u015b\u0107 us\u0142ug klienta (poczta, proxy http, IRC) b\u0119dzie korzysta\u0107 z tego samego zestawu tuneli i b\u0119dzie wymieniana jako <i>Wsp\u00f3lne klienty</i> lub <i>Wsp\u00f3lne klienty(DSA)</i>, co zwi\u0119ksza anonimowo\u015b\u0107 poprzez mieszanie ruchu z wszystkich wsp\u00f3\u0142dzielonych us\u0142ug i zmniejsza overhead wymagany do budowy i utrzymania tuneli. Jednak, w przypadku awarii tunelu, wszystkie twoje us\u0142ugi b\u0119d\u0105 wy\u0142\u0105czone w jednym momencie, dlatego w niekt\u00f3rych scenariuszach mo\u017cesz chcie\u0107 skonfigurowa\u0107 us\u0142ugi klienta tak, aby korzysta\u0142y z w\u0142asnego zestawu tuneli. Mo\u017cna to zrobi\u0107 przez odznaczenie opcji <i>Dzielenie tuneli z innymi klientami&hellip;</i>, znajduj\u0105cej si\u0119 w obszarze <i>Wsp\u00f3lne klienty</i> na stronie konfiguracji odpowiedniej us\u0142ugi klienta w Mened\u017cerze tuneli, po czym konieczne b\u0119dzie ponowne uruchomienie us\u0142ugi klienta ze strony <a href='/i2ptunnelmgr'>g\u0142\u00f3wnego Mened\u017cera Tuneli</a>.";
