    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Prosta aplikacja CGI, kt\u00f3ra przyjmuje nazw\u0119 hosta jako parametr i zwraca przekierowanie 301 na w\u0142a\u015bciwy adres URL z do\u0142\u0105czonym ci\u0105giem <code>?i2paddresshelper=key</code>. Interfejs HTTP przetworzy do\u0142\u0105czony ci\u0105g i u\u017cyje klucza jako rzeczywistego celu. Ponadto, interfejs buforuje klucz, aby pom\u00f3c w odnalezieniu adresu podanego do momentu ponownego uruchomienia, oraz oferuje opcj\u0119 dodania rozwi\u0105zanego adresu do ksi\u0105\u017cki adresowej.";
