    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Ponowne inicjowanie to proces uruchamiania u\u017cywany do wyszukiwania innych router\u00f3w po zainstalowaniu I2P lub gdy tw\u00f3j router ma zbyt ma\u0142o pozosta\u0142ych odwo\u0142a\u0144 do router\u00f3w. Domy\u015blne ustawienia b\u0119d\u0105 dzia\u0142a\u0107 dla wi\u0119kszo\u015bci os\u00f3b. Zmieniaj tylko w przypadku, gdy blokowane jest HTTPS przez restrykcyjny firewall i ponowne inicjowanie zako\u0144czy\u0142o si\u0119 niepowodzeniem.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Ta opcja, gdy jest w\u0142\u0105czona, modyfikuje maksymalne dodatkowe losowe op\u00f3\u017anienie pong, kt\u00f3re wprowadzane jest dla serwer\u00f3w obs\u0142uguj\u0105cych ping, je\u015bli <code>i2p.streaming.enablePongDelay</code> jest r\u00f3wnie\u017c w\u0142\u0105czone. Je\u015bli nie jest bezpo\u015brednio ustawione, zostanie u\u017cyta warto\u015b\u0107 domy\u015blna 50 ms.";
