    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Tw\u00f3j router I2P+ domy\u015blnie przyczynia si\u0119 do sieci poprzez przesy\u0142anie wewn\u0119trznego, wydajnie zaszyfrowanego ruchu mi\u0119dzyroutera dla innych router\u00f3w, znanego jako <i>uczestnictwo</i>. Uczestnictwo w przepustowo\u015bci poprawia poziom anonimowo\u015bci wszystkich u\u017cytkownik\u00f3w sieci i maksymalizuje pr\u0119dko\u015b\u0107 pobierania.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "To ustawienie umo\u017cliwia konfiguracj\u0119 alternatywnych serwer\u00f3w NTP wymaganych do zapewnienia, \u017ce Tw\u00f3j router utrzymuje dok\u0142adny czas zegara. [Domy\u015blnie 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Zoptymalizuj swoje obrazy";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
