    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Je\u015bli jeste\u015b w po\u015bpiechu i nie mo\u017cesz poczeka\u0107 kilka godzin, mo\u017cesz powiedzie\u0107 ludziom, \u017ceby skorzystali z \"skocz\" us\u0142ugi przekierowania adresu pomocnika. To zazwyczaj dzia\u0142a w ci\u0105gu kilku minut od zarejestrowania nazwy hosta na tej samej stronie. Sprawd\u017a to najpierw sam, wpisuj\u0105c <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>tw\u00f3jwybranynazwahosta.i2p</i></code> w przegl\u0105darce. Gdy zacznie dzia\u0142a\u0107, mo\u017cesz powiedzie\u0107 innym, \u017ceby go u\u017cywali.";
