    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunele budowane przez inne routery przez Tw\u00f3j serwer. Mo\u017ce si\u0119 to znacznie r\u00f3\u017cni\u0107 w zale\u017cno\u015bci od zapotrzebowania sieciowego, udost\u0119pnionego pasma i ilo\u015bci ruchu wygenerowanego lokalnie. Zalecan\u0105 metod\u0105 ograniczenia liczby uczestnicz\u0105cych tuneli jest zmiana udzia\u0142u pasma na stronie <a  href='/config'>Konfiguracja pasma</a>. Mo\u017cesz r\u00f3wnie\u017c ograniczy\u0107 ich ca\u0142kowit\u0105 liczb\u0119, ustawiaj\u0105c warto\u015b\u0107 <code>router.maxParticipatingTunnels=nnn</code> na stronie <a href='/configadvanced'>Zaawansowana konfiguracja</a>. <a href='/configstats#tunnel.participatingTunnels'>[W\u0142\u0105cz wykresy]</a>.";
