    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Aby skonfigurowa\u0107 alternatywny serwer WWW do u\u017cytku w I2P, mo\u017cesz albo u\u017cy\u0107 istniej\u0105cego tunelu serwera WWW i <a href=/configclients>wy\u0142\u0105czy\u0107 domy\u015blny serwer WWW</a>, lub utworzy\u0107 nowy tunel serwera HTTP w <a href=/i2ptunnelmgr>Kierownik Tuneli</a>. Upewnij si\u0119, \u017ce <i>port nas\u0142uchiwania</i> serwera WWW jest r\u00f3wnie\u017c skonfigurowany w ustawieniach Kierownika Tuneli. Na przyk\u0142ad, je\u015bli tw\u00f3j serwer WWW nas\u0142uchuje domy\u015blnie na adresie 127.0.0.1 port 80, musisz tak\u017ce upewni\u0107 si\u0119, \u017ce <i>port docelowy</i> na stronie ustawie\u0144 Kierownika Tuneli dla us\u0142ugi jest r\u00f3wnie\u017c skonfigurowany na port 80. ";
    t[10040] = "Torrents";
    t[10041] = "Torrenty";
