    t[10045] = "Proxy IRC";
    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Standardowo router I2P musi by\u0107 zasiewany tylko raz, aby po raz pierwszy do\u0142\u0105czy\u0107 do sieci. Jednak je\u015bli router dzia\u0142a przez d\u0142ugi czas bez po\u0142\u0105czenia z sieci\u0105, mo\u017ce r\u00f3wnie\u017c wymaga\u0107 ponownego zasiewania. Przesiewanie polega na pobieraniu wielu plik\u00f3w \"RouterInfo\" (zbieranych w podpisany plik ZIP) z co najmniej dw\u00f3ch wcze\u015bniej zdefiniowanych adres\u00f3w URL serwer\u00f3w. Serwery te s\u0105 obs\u0142ugiwane przez grup\u0119 serwer\u00f3w oferuj\u0105cych us\u0142ugi HTTPS w Internecie zwyk\u0142ym (Clearnet) i s\u0105 obs\u0142ugiwane przez wolontariuszy.";
