    t[10063] = "Ustawienie to okre\u015bla op\u00f3\u017anienie mi\u0119dzy zadaniami testowania s\u0105siad\u00f3w, skonfigurowane w milisekundach. [Domy\u015blnie warto\u015b\u0107 wynosi 5000]";
