    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Lista kraj\u00f3w pochodz\u0105ca z <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>Raportu o wolno\u015bci w \u015bwiecie</a> z nisk\u0105 reputacj\u0105 pod wzgl\u0119dem swob\u00f3d obywatelskich. Lista ta jest stosowana do umieszczania dzia\u0142aj\u0105cych w okre\u015blonych krajach router\u00f3w w trybie <i>Ukrytym</i>, aby zapewni\u0107 u\u017cytkownikom wi\u0119ksze bezpiecze\u0144stwo. Nast\u0119puj\u0105ce kraje s\u0105 uznawane za rygorystyczne: Afganistan, Azerbejd\u017can, Bahrajn, Bia\u0142oru\u015b, Brunei, Burundi, Kamerun, Republika \u015arodkowoafryka\u0144ska, Czad, Chiny, Kuba, Demokratyczna Republika Konga, Egipt, Gwinea R\u00f3wnikowa, Erytrea, Etiopia, Iran, Kazachstan, Laos, Libia, Myanmar, Korea P\u00f3\u0142nocna, Terytoria Palesty\u0144skie, Rwanda, Arabia Saudyjska, Somalia, Sudan Po\u0142udniowy, Sudan, Eswatini (Suazi), Syria, Tad\u017cykistan, Tajlandia, Turcja, Turkmenistan, Wenezuela, Zjednoczone Emiraty Arabskie, Uzbekistan, Sahara Zachodnia, Jemen.";
