    t[10312] = "Please wait for routing commitment to expire for {0} tunnel";
    t[10313] = new java.lang.String[] { "Prosz\u0119 poczeka\u0107 na wyga\u015bni\u0119cie zobowi\u0105zania routingu dla {0} tunelu", "Prosz\u0119 poczeka\u0107 na wyga\u015bni\u0119cie zobowi\u0105zania routingu dla {0} tuneli", "Prosz\u0119 poczeka\u0107 na wyga\u015bni\u0119cie zobowi\u0105zania routingu dla {0} tuneli" };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Tam, gdzie to mo\u017cliwe, upewnij si\u0119, \u017ce I2P+/Java ma dost\u0119p dwukierunkowy do port\u00f3w z Internetu, konfiguruj\u0105c odpowiednio modem/router/firewall na komputerze. Je\u015bli jeste\u015b za blokuj\u0105cym firewallem, ale masz nielimitowany dost\u0119p do przesy\u0142ania na zewn\u0105trz, I2P+ nadal mo\u017ce funkcjonowa\u0107; mo\u017cna wy\u0142\u0105czy\u0107 dost\u0119p przychodz\u0105cy i polega\u0107 na <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>Wykrywaniu Adresu IP SSU</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>rozwiercanie firewalla</a>) do po\u0142\u0105czenia z sieci\u0105, a status sieci w panelu bocznym wska\u017ce \"Status: Blokowany przez firewall\". Dla optymalnej wydajno\u015bci, upewnij si\u0119, \u017ce zewn\u0119trzny port I2P jest widoczny z Internetu (patrz poni\u017cej dla wi\u0119cej informacji).";
