    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Aby u\u017cywa\u0107 jednego zestawu tuneli dla wielu us\u0142ug klienta, klientom mo\u017cna skonfigurowa\u0107 tryb <i>Udost\u0119pnionego klienta</i> z <i>Mened\u017cera tuneli</i>. Tryb ten pozwala zaoszcz\u0119dzi\u0107 zasoby i mieszanie ruchu pochodz\u0105cego od wielu klient\u00f3w w jednym zestawie tuneli, co utrudnia analiz\u0119 ruchu. Klienci skonfigurowani jako Udost\u0119pnieni klienci dziel\u0105 te same opcje tuneli.";
