    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Tw\u00f3j modem lub router mo\u017ce obs\u0142ugiwa\u0107 <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), co umo\u017cliwia automatyczne przekierowywanie port\u00f3w. Upewnij si\u0119, \u017ce wsparcie UPnP dla I2P+ jest w\u0142\u0105czone na <a href=/confignet>stronie konfiguracyjnej</a>, a nast\u0119pnie spr\u00f3buj aktywowa\u0107 UPnP na swoim modemie/routerze, a tak\u017ce na swoim komputerze. Teraz spr\u00f3buj zrestartowa\u0107 router <a href=/>I2P+</a>. Je\u015bli si\u0119 uda, I2P+ powinien zg\u0142osi\u0107 \u201eStatus: OK\u201d w panelu bocznym po zako\u0144czeniu pocz\u0105tkowych test\u00f3w po\u0142\u0105czenia przez router I2P+.";
