    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "Gdy pakiety przychodz\u0105ce TCP s\u0105 akceptowane, ale port TCP jest chroniony przez zapor\u0119, routery nie b\u0119d\u0105 mog\u0142y si\u0119 z Tob\u0105 skontaktowa\u0107, co utrudni dzia\u0142anie sieci.";
    t[11984] = "Local Identity";
    t[11985] = "Lokalna to\u017csamo\u015b\u0107";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "Co prawda I2P b\u0119dzie dzia\u0142a\u0107 za wi\u0119kszo\u015bci\u0105 zap\u00f3r, ale Twoja szybko\u015b\u0107 i integracja z sieci\u0105 zwi\u0119kszy si\u0119, je\u015bli u\u017cyjesz przekierowania port\u00f3w UDP i TCP.";
