    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "Tunele d\u0142u\u017csze ni\u017c 3 skoki (na przyk\u0142ad 2 skoki + 0-2 skoki, 3 skoki + 0-1 skok, 3 skoki + 0-2 skoki) lub du\u017ca ilo\u015b\u0107 liczba podstawowych i zapasowych mog\u0105 powa\u017cnie zmniejszy\u0107 wydajno\u015b\u0107.";
