    t[12026] = "I2P FAQ";
    t[12027] = "Cz\u0119ste pytania";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Je\u015bli najedziesz kursorem na nag\u0142\u00f3wek <i>Router Info</i>, zostanie wy\u015bwietlona twoja identyfikacja skracana routera (pierwsze cztery znaki (24 bity) z 44-znakowego (256-bitowego) Base64 hasha routera). Pe\u0142ny hash jest wy\u015bwietlany w twoim <a href='netdb?r=.'>wpisie w bazie danych sieciowej</a>. Nigdy nie ujawniaj tego nikomu, poniewa\u017c twoja to\u017csamo\u015b\u0107 routera jest jednoznacznie powi\u0105zana z twoim adresem IP w bazie danych sieciowej.";
