    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Lista katalog\u00f3w (nazywana czasem list\u0105 wirtualnych katalog\u00f3w) jest domy\u015blnie w\u0142\u0105czona, dzi\u0119ki czemu mo\u017cesz hostowa\u0107 pliki z podkatalogu <code>docroot</code> bez dostarczania strony z linkami do tych plik\u00f3w. Mo\u017cesz r\u00f3wnie\u017c serwowa\u0107 tre\u015bci, kt\u00f3re znajduj\u0105 si\u0119 poza katalogiem <code>docroot</code>, u\u017cywaj\u0105c <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>link\u00f3w symbolicznych</a> do \u017c\u0105danego katalogu.";
