    t[12185] = "Ta opcja okre\u015bla liczb\u0119 kube\u0142k\u00f3w NetDb DHT, do kt\u00f3rych b\u0119dzie odwo\u0142ywa\u0142o si\u0119 zadanie eksploracji par podczas jego dzia\u0142ania. Domy\u015blnie liczba kube\u0142k\u00f3w do eksploracji b\u0119dzie si\u0119 r\u00f3\u017cni\u0107 w zale\u017cno\u015bci od tego, czy router dzia\u0142a\u0142 przez ponad godzin\u0119, czy jest ukryty lub z pr\u0119dko\u015bci\u0105 przepustow\u0105 na poziomie 'K', a tak\u017ce w zale\u017cno\u015bci od liczby znanych router\u00f3w.";
