    t[12199] = "Rejestracja nazwy hosta";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Je\u015bli liczba znanych peer\u00f3w spadnie poni\u017cej 50, I2P spr\u00f3buje automatycznie ponownie zasiewi\u0107. Je\u015bli pr\u00f3ba zasiewania zawiedzie, w panelu bocznym pojawi si\u0119 powiadomienie z mo\u017cliwo\u015bci\u0105 r\u0119cznego zasiewania. Nieudana pr\u00f3ba zasiewania mo\u017ce by\u0107 wynikiem ogranicze\u0144 zapory sieciowej na Twoim komputerze, problem\u00f3w z po\u0142\u0105czeniem sieciowym lub ca\u0142kowitego zablokowania \u017c\u0105dania zasiewu.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Alternatywny front-end skupiaj\u0105cy si\u0119 na prywatno\u015bci dla Reddit";
