    t[12225] = "Prze\u0142\u0105cz tunele";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Mo\u017ce by\u0107 wy\u0142\u0105czony w pliku <code>clients.config</code>. Mo\u017ce r\u00f3wnie\u017c by\u0107 skonfigurowany do wi\u0105zania z okre\u015blonym interfejsem lub wszystkimi interfejsami w pliku <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Mo\u017cesz ustali\u0107, kt\u00f3re us\u0142ugi automatycznie uruchamiaj\u0105 si\u0119 wraz z routerem, zarz\u0105dza\u0107 alokacj\u0105 tuneli w celu optymalizacji dla us\u0142ug o du\u017cym nat\u0119\u017ceniu ruchu lub minimalizacji obci\u0105\u017cenia procesora i pami\u0119ci, dodawa\u0107 tunele serwerowe i klienckie do hostowania lub dost\u0119pu do us\u0142ug w sieci, ustawia\u0107 limitowanie pr\u0119dko\u015bci lub filtrowanie tuneli dla tuneli serwerowych i wiele wi\u0119cej.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "\u0141\u0105czy si\u0119 z adresem LANu. Mo\u017ce zosta\u0107 zmieniony za pomoc\u0105 zaawansowanej konfiguracji <code>i2np.upnp.HTTPPort=nnnn</code>. Mo\u017ce zosta\u0107 wy\u0142\u0105czony na <a href=/confignet>stronie Konfiguracja Sieci</a>.";
    t[12234] = "Data transferred";
    t[12235] = "Dane przes\u0142ane";
